    n = int(stdin.readline().strip())
    edges = set()
    for _ in range(n - 1):
        a, b = map(int, stdin.readline().strip().split())
        edges.add((a, b))
        edges.add((b, a))

    def max_path_length(a, b, visited):
        if a == b or (a, b) in visited:
            return 0
        visited.add((a, b))
        path_length = 1
        for u in edges:
            if u[0] == a and u[1] == b:
                path_length += max_path_length(u[0], b, visited)
            elif u[0] == b and u[1] == a:
                path_length += max_path_length(a, u[1], visited)
        visited.remove((a, b))
        return path_length

    max_length = 0
    for u in range(1, n):
        for v in range(u + 1, n):
            if (u, v) not in edges and max_path_length(u, v, set()) > max_length:
                max_length = max_path_length(u, v, set())

    res = 0
    for u in range(1, n):
        for v in range(u + 1, n):
            if (u, v) not in edges and max_length > res:
                res = max_length
                a, b, c = u, v, n
                if (a, b) not in edges and max_path_length(a, b, set()) > res:
                    res = max_path_length(a, b, set())
                if (b, c) not in edges and max_path_length(b, c, set()) > res:
                    res = max_path_length(b, c, set())
                if (a, c) not in edges and max_path_length(a, c, set()) > res:
                    res = max_path_length(a, c, set())

