        edges.append((u, v))
        edges.append((v, u))

    def dfs(v, visited):
        if visited[v]:
            return True

        visited[v] = True

        for u, w in edges:
            if w == v:
                continue

            if not dfs(u, visited):
                return False

        return True

    if not dfs(1, [False] * n):
        return "NO"

    spanning_tree = []
    stack = [(1, 0)]

    while stack:
        v, level = stack.pop()

        if level == D:
            spanning_tree.append((v, level))
            continue

        for u, w in edges:
            if w == v:
                continue

            if not dfs(u, visited):
                stack.append((u, level + 1))

    spanning_tree.sort(key=lambda x: x[1])

    for v, degree in enumerate(spanning_tree):
        print(" ".join(map(str, degree)))

    return "YES"

