    queue = [(1, [])]
    while queue:
        size = len(queue)
        for _ in range(size):
            vertex, path = queue.pop(0)
            if vertex in visited:
                continue
            visited.add(vertex)
            path_lengths[vertex] = len(path)
            for neighbor, edge in edges:
                if neighbor in visited:
                    continue
                if edge == (vertex, neighbor):
                    queue.append((neighbor, path + [neighbor]))
    # count the number of paths that visit all vertices exactly once
