    def dfs(u, tree, visited, total_weight, total_weight_exceeds):
        nonlocal total_weight_exceeds

        visited.add(u)
        total_weight += tree[u]

        for v in tree[u]:
            if v not in visited and not total_weight_exceeds(u, v, k):
                dfs(v, tree, visited, total_weight, total_weight_exceeds)

        total_weight -= tree[u]
        visited.remove(u)

    total_weight = 0
    total_weight_exceeds = set(range(n))

    for i in range(n - 1):
        u, v = edges[i]
        if u < v:
            dfs(u, tree, set(), 0, total_weight_exceeds)

    return str(total_weight)

