    q_set = set(q)

    # Check if p is a subset of q
    if not p_set.issubset(q_set):
        return "Error: p is not a subset of q"

    # Perform operations on p to obtain q
    operations = []
    for i in range(n - 1):
        if i < n - 2 and p[i+1] > p[i]:
            operations.append(1)
        elif i < n - 2 and p[i] == p[i+1] and p[i+1] < p[i+2]:
            operations.append(2)
        else:
            operations.append(0)

    # Reverse operations and obtain q
    operations.reverse()
    q = list(set(q_set - p_set).union(set(p_set - q_set)).union(q_set))

    return " ".join(map(str, q))

