    participants = []
    for i in range(N):
        line = input().strip()
        if line[0] == 'Y':
            participants.append(('Y', line[1:4]))
        else:
            participants.append(('N', line[1:4]))

    # Calculate efficacy for each strain
    efficacies = {}
    for strain in ['A', 'B', 'C']:
        efficacies[strain] = 0
        for participant, status in participants:
            if status == strain:
                efficacies[strain] += 1

    # Calculate efficacy for control group
    control_efficacy = 0
    for participant, status in participants:
        if status == 'N':
            control_efficacy += 1

    # Calculate vaccine efficacy
    vaccine_efficacy = 1 - control_efficacy / (efficacies['A'] + efficacies['B'] + efficacies['C'])

    # Print output
    if vaccine_efficacy >= 1:
        print("Not Effective")
    else:
        print(f"{vaccine_efficacy:.2f}")

    return "success"

