        # Check if clause is satisfiable
        for i in range(3):
            if clauses.count(clause) < 3 or not variables.intersection(clause):
                continue
            if not variables.issuperset(clause[i:]):
                return "unsatisfactory"
            variables.remove(clause[i])
        # Check if clause is unsatisfiable
        for i in range(3, 8):
            if clauses.count(clause) < 3 or not variables.intersection(clause):
                continue
            if not variables.isdisjoint(clause[i:]):
                return "unsatisfactory"
            variables.remove(clause[i])
        # Check if clause is unsatisfiable
        for i in range(8, 12):
            if clauses.count(clause) < 3 or not variables.intersection(clause):
                continue
            if not variables.issubset(clause[i:]):
                return "unsatisfactory"
            variables.remove(clause[i])
        # Check if clause is unsatisfiable
        for i in range(12, 15):
            if clauses.count(clause) < 3 or not variables.intersection(clause):
                continue
            if not variables.difference(clause[i:]):
                return "unsatisfactory"
            variables.remove(clause[i])
        # Check if clause is unsatisfiable
        for i in range(15, 18):
            if clauses.count(clause) < 3 or not variables.intersection(clause):
                continue
            if not variables.issubset(clause[i:]):
                return "unsatisfactory"
            variables.remove(clause[i])
        # Check if clause is unsatisfiable
        for i in range(18, 21):
            if clauses.count(clause) < 3 or not variables.intersection(clause):
                continue
            if not variables.issubset(clause[i:]):
