def solution(stdin: str) -> str:
    N = int(stdin.strip())
    cutters = []
    for _ in range(N):
        x1, y1 = map(float, stdin.strip().split())
        x2, y2 = map(float, stdin.strip().split())
        cutters.append((x1, y1, x2, y2))

    def area(x1: float, y1: float, x2: float, y2: float, x3: float, y3: float, x4: float, y4: float) -> float:
        return abs(x1 * y2 - x2 * y1 + x3 * y4 - x4 * y3)

    def relative_error(x1: float, y1: float, x2: float, y2: float) -> float:
        return abs(x1 - x2) + abs(y1 - y2)

    def shrink(cutter: tuple, area: float) -> tuple:
        x1, y1 = cutter
        x2, y2 = min(cutter[0], cutter[2]), max(cutter[1], cutter[3])
        new_area = area * (x2 - x1) / (y2 - y1)
        x1, y1 = min(0, x1), min(0, y1)
        x2, y2 = max(x2 + new_area, 1), max(y2 + new_area, 1)
        return (x1, y1), (x2, y2)

    def grow(cutter: tuple, area: float) -> tuple:
        x1, y1 = cutter
        x2, y2 = min(cutter[0], cutter[2]), max(cutter[1], cutter[3])
        new_area = area / (x2 - x1) * (y2 - y1)
        x1, y1 = min(0, x1), min(0, y1)
        x2, y2 = max(x2 - new_area, 1), max(y2 - new_area, 1)
        return (x1, y1), (x2, y2)

    cutters = sorted(cutters, key=lambda x: x[0])

    total_area = sum(area(cutter[0], cutter[1], cutter[2], cutter[3], cutter[4], cutter[5], cutter[6], cutter[7]))

    for i in range(N):
        for j in range(i + 1, N):
            if area(cutters[i][0], cutters[i][1], cutters[i][2], cutters[i][3], cutters[j][0], cutters[j][1], cutters[j][2], cutters[j][3]) > total_area * 0.1:
                cutters[i], cutters[j] = cutters[j], cutters[i]

    for i in range(N):
        if area(cutters[i][0], cutters[i][1], cutters[i][2], cutters[i][3], cutters[i][4], cutters[i][5], cutters[i][6], cutters[i][7]) > total_area * 0.1:
            cutters[i], cutters[-1] = cutters[-1], cutters[i]

    x_min, y_min = min(cutters[i][0] for cutter in cutters), min(cutters[i][1] for cutter in cutters)
    x_max, y_max = max(cutters[i][2] for cutter in cutters), max(cutters[i][3] for cutter in cutters)
    x_range = x_max - x_min
    y_range = y_max - y_min

    for i in range(N):
        cutter = cutters[i]
        x, y = cutter
        if x < 0:
            x += x_range
        elif x > x_range:
            x -= x_range
        if y < 0:
            y += y_range
        elif y > y_range:
            y -= y_range
        cutters[i] = (x, y)

    return '\n'.join(map(str, cutters))

