        '4': '1', '5': '6', '6': '4', '7': '0', '8': '2', '9': '8'
    }

    def encrypt(plaintext, key):
        encrypted = []
        for i in range(len(plaintext)):
            if len(encrypted) == len(plaintext):
                break
            if i == 0 or plaintext[i]!= plaintext[i-1]:
                encrypted.append(plaintext[i])
                if i == len(plaintext)-1 or plaintext[i]!= plaintext[i+1]:
                    encrypted.append(key[i % len(key)])
        return encrypted

    encrypted_text = encrypt(plaintext, key_phrase)

    result = ''
    for digit in encrypted_text:
        result += table[digit.upper()]

    return result

